    false,nt"url": null,nt"notes": "This data set contains vector points and
    lines representing human-use resource data for Columbia River. In the data set,
    vector points represent aquaculture sites, boat ramps, coast guard stations, ferry
    sites, hatchery sites, locks and dams, marinas, recreational fishing sites, subsistence
    sites, and water intakes. Vector lines represent roads, bridges, and state borders.
    Location-specific type and source information are stored in relational data tables
    (described below) designed to be used in conjunction with this spatial data layer.This
    data set comprises a portion of the Environmental Sensitivity Index (ESI) data for
    Columbia River. ESI data characterize the marine and coastal environments and wildlife
    by their sensitivity to spilled oil. The ESI data include information for three
    main components: shoreline habitats, sensitive biological resources, and human-use
    resources. See also the MGT (Management Area Polygons) data layer, part of the larger
    Columbia River ESI database, for additional human-use information.",nt"license_title":
